{
  "chart": {
    "type": "heatmap",
    "marginTop": 40,
    "marginBottom": 40,
    "plotBorderWidth": 0
  },
  "xAxis": {
    "categories": ["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"],
    "min": 0,
    "max": 6,
    "opposite": true, //Position X axis on top side of chart
    "lineWidth": 26, //X axis line width
    "offset": 13, //Shift the axis line up by half the width to avoid overlap with heatmap.
    "lineColor": "#fafafa",
    "gridLineWidth": 0.5,
    "gridLineColor": "#fafafa",
    "labels": {
      "y": 20, //Shift X axis label down to position over axis line.
      "style": {
        "textTransform": "uppercase",
        "fontWeight": "800"
      }
    }
  },
  "yAxis": {
    "categories": ["unique", ["getColumn", 1]], //Keeping weeks dynamic
    "min": 0,
    "title": {
      "text": ""
    },
    "reversed": true,
    "gridLineWidth": 0.5,
    "gridLineColor": "#fafafa",
    "labels": {
      "enabled": false
    }
  },
  "colorAxis": {
    "min": 0,
    "stops": [
      [0.2, "#FBFFFB"],
      [0.4, "#CDFFCD"],
      [0.6, "#89FF89"],
      [0.8, "#5BFF5B"],
      [0.9, "#00DA00"]
    ]
  },
  "legend": {
    "align": "right",
    "layout": "vertical",
    "margin": 10,
    "verticalAlign": "top",
    "y": 55,
    "symbolHeight": 280
  },
  "tooltip": {
    "format": "<b>Date : </b> {point.date:%Y-%m-%d} <br><b>Cost : </b> ${point.value:,.2f} "
  },
  "series": [
    {
      "name": "Daily Sales",
      "borderWidth": 0.5,
      "borderColor": "#fafafa",
      "data": [
        "map", //Shaping data to below specified JSON format.
        ["getColumn", 0, 1, 2, 3, 4],
        {
          "x": ["get", ["item"], 0], //Calendar Day Index
          "y": ["get", ["item"], 1], //Calendar Week Index
          "date": ["get", ["item"], 2], //Order Date
          "dayOfMonth": ["get", ["item"], 3], //Day Of Month
          "value": ["get", ["item"], 4] //cost
        }
      ],
      "dataLabels": [
        //Position day of month on top left of each heatmap cell.
        {
          "enabled": true,
          "format": "{point.dayOfMonth}",
          "align": "left",
          "verticalAlign": "top",
          "color": "#000000",
          "backgroundColor": "#fafafa",
          "padding": 2,
          "x": 1,
          "y": 1,
          "style": {
            "textOutline": "none",
            "fontWeight": "bold",
            "fontSize": "12px"
          }
        },
        //Use default label position for Sales
        {
          "enabled": true,
          "format": "${point.value:,.2f}",
          "color": "black",
          "style": {
            "textOutline": "none",
            "fontWeight": "normal",
            "fontSize": "12px"
          }
        }
      ]
    }
  ]
}

calculatedFields.expression:
//Get the week number, rounded down, without any decimals
floor(
    //Get an index starting from first Sunday (top left cell) in the calendar display
    (
        //Get the day index for first day of Month; Sunday = 0, Monday =1 ..Saturday = 6
        extract('WD',truncDate('MM',{date_to}))-1
        +
        //Get day of month converted to start at 0
        extract('DD',{date_to})-1
    )
    /
    //Divide above index by 7 to convert to weeks
    7
)

ifelse(
    ${granularity} = 'MONTHLY',
    addDateTime(-1, 'DD', addDateTime(1, 'MM', truncDate('MM', {date_to}))),
    ifelse(
        ${granularity} = 'YEARLY',
        addDateTime(-1, 'DD', addDateTime(1, 'YYYY', truncDate('YYYY', {date_to}))),
        {date_from}
    )
)

ifelse(
    ${granularity} = 'MONTHLY',
    addDateTime(-1, 'DD', 
        addDateTime(1, 'MM', 
            parseDate(formatDate({date_to}, 'yyyy-MM-01'))
        )
    ),
    ifelse(
        ${granularity} = 'YEARLY',
        parseDate(formatDate({date_to}, 'yyyy-12-31')),
        {date_to}
    )
)

//Get the week number, rounded down, without any decimals
floor(
    //Get an index starting from first Sunday (top left cell) in the calendar display
    (
        //Get the day index for first day of Month; Sunday = 0, Monday =1 ..Saturday = 6
        extract('WD',truncDate('MM',{date_to}))-1
        +
        //Get day of month converted to start at 0
        extract('DD',{date_to})-1
    )
    /
    //Divide above index by 7 to convert to weeks
    7
)
